import React, { useState } from 'react';

const LandingPage = () => {
  const [leagueId, setLeagueId] = useState('');
  const [swid, setSwid] = useState('');
  const [espnS2, setEspnS2] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission here
    console.log('Submitted:', { leagueId, swid, espnS2 });
  };

  return (
    <div className="min-h-screen bg-gray-100 flex items-center justify-center">
      <div className="bg-white p-8 rounded-lg shadow-md w-full max-w-md">
        <h1 className="text-3xl font-bold text-center mb-4">Welcome to Fantasy Football</h1>
        <p className="text-gray-600 text-center mb-6">
          Enter your league details to get started
        </p>
        <form onSubmit={handleSubmit}>
          <div className="mb-4">
            <label htmlFor="leagueId" className="block text-gray-700 text-sm font-bold mb-2">
              League ID
            </label>
            <input
              type="text"
              id="leagueId"
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              value={leagueId}
              onChange={(e) => setLeagueId(e.target.value)}
              required
            />
          </div>
          <div className="mb-4">
            <label htmlFor="swid" className="block text-gray-700 text-sm font-bold mb-2">
              SWID
            </label>
            <input
              type="text"
              id="swid"
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              value={swid}
              onChange={(e) => setSwid(e.target.value)}
              required
            />
          </div>
          <div className="mb-6">
            <label htmlFor="espnS2" className="block text-gray-700 text-sm font-bold mb-2">
              ESPN S2
            </label>
            <input
              type="text"
              id="espnS2"
              className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              value={espnS2}
              onChange={(e) => setEspnS2(e.target.value)}
              required
            />
          </div>
          <button
            type="submit"
            className="w-full bg-blue-500 text-white py-2 px-4 rounded-md hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-opacity-50"
          >
            Submit
          </button>
        </form>
      </div>
    </div>
  );
};

export default LandingPage;
